    false,nt"url": null,nt"notes": "NODC Accession 0108062 includes chemical,
    discrete sample, physical, profile and underway - surface data collected from THOMAS
    G. THOMPSON in the Gulf of Alaska, North Pacific Ocean and South Pacific Ocean from
    2006-02-13 to 2006-03-30 and retrieved during cruise 325020060213. These data include
    ALKALINITY, CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-113 (CFC-113), CHLOROFLUOROCARBON-12
    (CFC-12), DELTA CARBON-13, DELTA CARBON-14, DISSOLVED INORGANIC CARBON, DISSOLVED
    ORGANIC CARBON, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRITE, PHOSPHATE,
    Partial pressure (or fugacity) of carbon dioxide, Potential temperature (theta),
    SALINITY, SEA SURFACE TEMPERATURE, SILICATE, Total Dissolved Nitrogen (TDN), WATER
    TEMPERATURE and pH. The instruments used to collect these data include Alkalinity
    titrator, CTD, Carbon dioxide (CO2) gas analyzer, Coulometer for DIC measurement,
    Flask with closed headspace for discrete carbon dioxide (CO2) measurement, Spectrophometer
    for pH measrement, automated Multi-parameter Inorganic Carbon Analyzer (MICA) for
    autonomous measurement of pH, carbon dioxide (CO2) and dissolved inorganic carbon
    (DIC) and bottle. These data were collected by Frank J. Millero and Dennis Hansell
    of Rosenstiel School of Marine and Atmospheric Science, Rik Wanninkhof of US DOC;
    NOAA; OAR; Atlantic Oceanographic and Meteorological Laboratory, Christopher Sabine
    and Richard A. Feely of US DOC; NOAA; OAR; Pacific Marine Environmental Laboratory
    and Dr. Robert H. Byrne of University of South Florida as part of the CLIVAR_P16N_2006
    and Underway Measurements during CLIVAR Section P16N_2006 data set.nnThe International
    CLIVAR Global Ocean Carbon and Repeat Hydrography Program carries out a systematic
    and global re-occupation of select WOCE/JGOFS hydrographic sections to quantify
    changes in storage and transport of heat, fresh water, carbon dioxide (CO2), and
    related parameters.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
